// src/App.js
import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import HomePage from "./pages/HomePage";
import ProductListPage from "./pages/ProductsListPage";
import ProductDetailsPage from "./pages/ProductDetailsPage";
import ProductCreatePage from "./pages/ProductCreatePage";
import ProductUpdatePage from "./pages/ProductUpdatePage";

import CheckoutPage from "./pages/CheckoutPage";
import CartPage from "./pages/CartePage";              // ðŸ†• page Panier

import PaymentStatus from "./components/PaymentStatus";
import NavBar from "./components/Navbar";
import BrandBar from "./components/BrandBar";
import WishlistPage from "./pages/WishlistPage";
import ShippingRatesPage from "./pages/ShippingRatesPage";

import Login from "./pages/LoginPage";
import Register from "./pages/RegisterPage";
import AccountPage from "./pages/AccountPage";
import AccountUpdatePage from "./pages/AccountUpdatePage";
import DeleteUserAccountPage from "./pages/DeleteUserAccountPage";
import CardDetailsPage from "./pages/CardDetailsPage";
import CardUpdatePage from "./pages/CardUpdatePage";
import AllAddressesOfUserPage from "./pages/AllAddressesOfUserPage";
import AddressUpdatePage from "./pages/AddressUpdatePage";
import OrdersListPage from "./pages/OrdersListPage";
import NotFound from "./pages/NotFoundPage";
import BrandsPage from "./pages/BrandsPage";
import BrandCollectionPage from "./pages/BrandCollectionPage";
import TopBar from "./components/TopBar";
import "./App.css";

/* ðŸ›’ Panier (global) */
import CartProvider from "./cart/CartProvider";
import CartDrawer from "./components/CartDrawer";
import ContactPage from "./pages/ContactPage";
import AboutPage from "./pages/AboutPage";

import PrivacyPage from "./pages/PrivacyPage";
import ReturnsPage from "./pages/ReturnsPage";
import PrivateRoute from "./routes/PrivateRoute";

const App = () => {
  return (
    <Router>
      <TopBar />
      <CartProvider>
        <header className="site-header">
          <BrandBar />
          <NavBar />
        </header>
        <CartDrawer />

        <div className="container mt-4">
          <Switch>
            {/* ---------- Public routes ---------- */}
            <Route path="/login" exact component={LoginPage} />
            <Route path="/register" exact component={RegisterPage} />
            <Route path="/brands" exact component={BrandsPage} />
            <Route path="/brand/:slug" exact component={BrandCollectionPage} />
            <Route path="/contact" exact component={ContactPage} />
            <Route path="/about" exact component={AboutPage} />
            <Route path="/privacy" exact component={PrivacyPage} />
            <Route path="/returns" exact component={ReturnsPage} />

            {/* ---------- Protected routes ---------- */}
            <PrivateRoute path="/" exact component={HomePage} />
            <PrivateRoute path="/products" exact component={ProductsListPage} />
            <PrivateRoute path="/product/:id/" exact component={ProductDetailsPage} />
            <PrivateRoute path="/new-product/" exact component={ProductCreatePage} />
            <PrivateRoute path="/product-update/:id/" exact component={ProductUpdatePage} />
            <PrivateRoute path="/cart" exact component={CartPage} />
            <PrivateRoute path="/checkout" exact component={CheckoutPage} />
            <PrivateRoute path="/product/:id/checkout/" exact component={CheckoutPage} />
            <PrivateRoute path="/payment-status" exact component={PaymentStatus} />
            <PrivateRoute path="/account" exact component={AccountPage} />
            <PrivateRoute path="/account/update/" exact component={AccountUpdatePage} />
            <PrivateRoute path="/account/delete/" exact component={DeleteUserAccountPage} />
            <PrivateRoute path="/stripe-card-details" exact component={CardDetailsPage} />
            <PrivateRoute path="/stripe-card-update" exact component={CardUpdatePage} />
            <PrivateRoute path="/all-addresses/" exact component={AllAddressesOfUserPage} />
            <PrivateRoute path="/all-addresses/:id/" exact component={AddressUpdatePage} />
            <PrivateRoute path="/all-orders/" exact component={OrdersListPage} />

            {/* 404 fallback for authenticated users */}
            <PrivateRoute path="/404" exact component={NotFound} />

            {/* If nothing matched: redirect guests to login, users to 404 */}
            <Route
              render={() => (
                <Redirect to="/login" />
              )}
            />
          </Switch>
        </div>
      </CartProvider>
    </Router>
  );
};

export default App;
